        setOrder(order1)
    }

    return (
        <div className="App">
            <div className="Side1">
            <h1>Client</h1>
            <h3>Je Veux:</h3>
            <input onChange={order1}></input>
            <button>Demander</button>
            <h3>Serveur :</h3>
            <p>Voila votre demande {order1} Desole jus d'orange n'existe pas dans notre menu</p>
            </div>
            <div class = "vertical"></div>
            <div className="Side2">
            <br></br>
            <h1>Cafe</h1>
